import React, {Fragment} from "react";
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import "./style/App.css";
import Header from "./components/layout/Header";

const App = () => {
	return (
		<Router>
			<Fragment>
				<Header />
			</Fragment>
		</Router>
	)
}

export default App;
